import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
  return(
    <header className="header">
    <div className="container">

      <div className="header__wrapper">
      <div className="header__logo">
        <h1 className="header__title">Cozy House</h1>
        <p className="header__desc">Shelter for pets in Boston</p>
      </div>

      {/* <div className="header__links">
        <ul className="header__ul">
          <li>
            <a href="/about" className="header__link">About the shelter</a>
          </li>
          <li>
            <a className="header__link">Our pets</a>
          </li>
          <li>
            <a className="header__link">Help the shelter</a>
          </li>
          <li>
            <a className="header__link">Contacts</a>
          </li>
        </ul>
      </div> */}

      </div>
    </div>
    </header>
  );
};

export default Header;
